정말드물다;

신캐?
아니 그보다 교황청 저거, 중세 수준으로 타락했네;;
자비, 이웃사랑, 원수마저 사랑하는 희생의 자세는 어따 팔아먹었어

뭘 오글거려 걍 작가좋고 독자도 기대된다 이거지 
